let timer = null;

self.onmessage = function(e) {
  if (e.data.command === 'start') {
    // Start the timer
    setTimeout(() => {
      timer = setInterval(() => {
        self.postMessage({ type: 'tick' });
      }, 1000);
    }, 1000); // Wait 1s before first tick
  } else if (e.data.command === 'stop') {
    // Stop the timer
    if (timer) {
      clearInterval(timer);
      timer = null;
    }
  }
};
